import React from 'react'
import { Card, CardActionArea, CardContent, CardMedia } from '@material-ui/core'
import { Typography } from '@mui/material'


export default function ProjectInforItem({
    projImg,
    projectName,
    projectDesc,
    techUsed
}
) {
  return (
    <div>
        <Card sx={{ Width: 300 }}>
            <CardActionArea>
                <CardMedia
                    component='img'
                    height='140'
                    src= {projImg}
                    alt='finicial'
                />
                <CardContent>
                    <Typography variant="h5" component="div">
                        {projectName}
                    </Typography>
                        {projectDesc}
                    <Typography>
                        {techUsed}
                    </Typography>
                </CardContent>
            </CardActionArea>
        </Card>
    </div>
  )
}
